import React, { Component } from "react";

const style = {
  container: {
    backgroundColor: "#FF5F5F",
    padding: 5,
    display: "flex",
    alignItems: "center",
    justifyContent: "center",
    borderRadius: 15
  },
  text: {
    color: "#fff",
    textAlign: "center",
    padding: 0,
    margin: 0,
    fontSize: 10,
    fontWeight: "normal"
  }
};

export const RemoveTaskButton = () => {
  return (
    <div style={style.container}>
      <h4 style={style.text}>{"Remove task"}</h4>
    </div>
  );
};

export default RemoveTaskButton;
